import { NgModule } from "@angular/core";
import { CommonModule } from "@angular/common";

import { Component } from "@angular/core";

@Component({
  selector: "my-component, MyComponent",
  template: `
    <div class="div">
      <span class="span">
        <img
          loading="lazy"
          src="https://cdn.builder.io/api/v1/image/assets/TEMP/3ec20a2053942c94f52f32355930656e3a5360147fc4560170ccde0e36f4ed28?apiKey=14a33fd9a33245f09b1bd9ed8f796835&"
          class="img"
        />
        <div class="div-2">AdsTrees</div>
      </span>
      <div class="div-3">
        <button class="span-2">
          <img
            loading="lazy"
            src="https://cdn.builder.io/api/v1/image/assets/TEMP/246fa02aaebe38276395e3ba2839e5642ec57f7bdb118b412c7d18dee08bc77a?apiKey=14a33fd9a33245f09b1bd9ed8f796835&"
            class="img-2"
          />
          <div class="div-4">Dashboard</div>
        </button>
        <button class="span-3">
          <img
            loading="lazy"
            src="https://cdn.builder.io/api/v1/image/assets/TEMP/a8a0db7fe9cd4f1b3d8efd44cf90d36254f324a52260cf1a0bd15762119331fb?apiKey=14a33fd9a33245f09b1bd9ed8f796835&"
            class="img-3"
          />
          <div class="div-5">Profile</div>
        </button>
      </div>
    </div>
  `,
  styles: [
    `
      .div {
        align-content: center;
        align-self: stretch;
        flex-wrap: wrap;
        background-color: var(--whitePure, #081c15);
        display: flex;
        justify-content: space-between;
        gap: 20px;
        padding: 8px 16px;
      }
      .span {
        display: flex;
        justify-content: space-between;
        gap: 8px;
      }
      .img {
        aspect-ratio: 1;
        object-fit: contain;
        object-position: center;
        width: 48px;
        overflow: hidden;
        max-width: 100%;
      }
      .div-2 {
        color: var(--greenDark, #e8f5f1);
        align-self: center;
        flex-grow: 1;
        white-space: nowrap;
        margin: auto 0;
        font: 400 24px Montserrat, sans-serif;
      }
      @media (max-width: 991px) {
        .div-2 {
          white-space: initial;
        }
      }
      .div-3 {
        align-self: center;
        display: flex;
        gap: 16px;
        margin: auto 0;
      }
      .span-2 {
        justify-content: space-between;
        align-items: center;
        border-radius: 21px;
        border: 1px solid var(--greenDark, #e8f5f1);
        background-color: var(--whitePure, #081c15);
        display: flex;
        gap: 4px;
        padding: 10px 12px; /* Adjusted padding for more space */
        color: #fff; /* Text color */
        font-size: 16px; /* Font size */
        cursor: pointer; /* Change cursor to pointer on hover */
        transition: background-color 0.3s ease; /* Add a smooth transition for background color */
      }

      .span-2:hover {
        background-color: #0a251d; /* Change background color on hover */
      }
      .img-2 {
        aspect-ratio: 1;
        object-fit: contain;
        object-position: center;
        width: 16px;
        fill: var(--greenDark, #e8f5f1);
        overflow: hidden;
        max-width: 100%;
        margin: auto 0;
      }
      .div-4 {
        color: var(--greenDark, #e8f5f1);
        align-self: stretch;
        flex-grow: 1;
        white-space: nowrap;
        font: 500 14px Poppins, sans-serif;
      }
      @media (max-width: 991px) {
        .div-4 {
          white-space: initial;
        }
      }
      .span-3 {
        justify-content: space-between;
        align-items: center;
        border-radius: 21px;
        border: 1px solid var(--greenDark, #e8f5f1);
        background-color: var(--whitePure, #081c15);
        display: flex;
        gap: 4px;
        padding: 10px 12px; /* Adjusted padding for more space */
        color: #fff; /* Text color */
        font-size: 16px; /* Font size */
        cursor: pointer; /* Change cursor to pointer on hover */
        transition: background-color 0.3s ease; /* Add a smooth transition for background color */
      }


      .img-3 {
        aspect-ratio: 1;
        object-fit: contain;
        object-position: center;
        width: 16px;
        fill: var(--greenDark, #e8f5f1);
        overflow: hidden;
        max-width: 100%;
        margin: auto 0;
      }
      .div-5 {
        color: var(--greenDark, #e8f5f1);
        align-self: stretch;
        flex-grow: 1;
        white-space: nowrap;
        font: 500 14px Poppins, sans-serif;
      }
      @media (max-width: 991px) {
        .div-5 {
          white-space: initial;
        }
      }
    `,
  ],
})
export class MyComponent {}
